import React, { useEffect, useState } from 'react';

import Pagination from 'react-js-pagination';

const ReactPagination = ({}) => {
  return (
    <Pagination
      className="text-left"
      itemClass="page-item"
      linkClass="page-link"
      prevPageText="Previous"
      nextPageText="Next"
    />
  );
};

export default ReactPagination;
